// src/admin/AdminProfile.js
import React from 'react';
import './AdminProfile.css';

const AdminProfile = () => {
  return (
    <div className="admin-profile-container">
      <h2>Admin Profile</h2>
      <p>Name: Admin User</p>
      <p>Email: admin@example.com</p>
      {/* Add other profile details here */}
    </div>
  );
};

export default AdminProfile;
